import './App.css';
import Home from './components/Home/Home';
import Partie from './components/Partie/Partie';
import { Routes, Route } from "react-router-dom";

function App() {
  return (
        <>
              <Routes>
                <Route exact path='/' component={<Home />}/>
                <Route exact path='/partie' component={<Partie />}/>
              </Routes>
        </>
);
}

export default App;
